import React, { useEffect } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Routes,
} from 'react-router-dom';
import AOS from 'aos';
import Home from './pages/Home/Home';

function App() {
  // Initialize AOS in your main JavaScript file (e.g., App.js)
  useEffect(() => {
    AOS.init({
      duration: 1200,
    });
  }, []);

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        {/* Add more routes here for other pages as you build them */}
      </Routes>
    </Router>
  );
}

export default App;
